response.about:
Стивен Лаберж даёт множество простых методик, которые позволяют понять, спите вы или нет:

—  Найти отличие обстановки сновидения от обстановки аналогичного места в реальной действительности;
—  Попробовать закрыть рот и нос, если вы при этом дышите, значит вы во сне;
— Попробовать прочесть что-нибудь дважды — если надпись меняется, значит, вы спите;
—  Посмотреть 2-3 раза на часы с циферблатом; Если время меняется, значит вы спите. 
— Вообще посмотреть на что-либо, что в реальности несёт определённую информацию. Информация может меняться;
Прокрутить в голове предыдущую минуту — если вы не смогли это сделать, вы, скорее всего, спите;
— Попробовать включить или выключить свет в комнате при помощи выключателя. Во сне выключатель может не работать, или порождать странный эффект, когда свет горит, но всё равно темно.
— Долго смотреть на свои руки — в сновидении они начинают изменять внешний вид.
— Также можно долго смотреть на себя в зеркало. Обычно отражение в зеркале во сне видоизменяется.

В дополнение к вышеописанным советам можно отнести и следующие:

— Присмотритесь к внешности человека из постоянного вашего окружения (например, одноклассника, одногруппника, коллеги, родственника или друга). В сновидении его внешность может быть неестественно искажена, либо же вообще иметь облик другого человека из вашего же окружения.
